import React from 'react';
import { FaHome, FaBell, FaCamera } from 'react-icons/fa'; // Iconos
import './../styles.css'; // Archivo de estilos para el toolbar

function Toolbar({ onNavigate }) {
  return (
    <div className="toolbar">
      <div className="toolbar-item" onClick={() => onNavigate('/dashboard')}>
        <FaHome size={24} />
        <p>Inicio</p>
      </div>
      <div className="toolbar-scan" onClick={() => onNavigate('/scan')}>
        <FaCamera size={24} />
      </div>
      <div className="toolbar-item" onClick={() => onNavigate('/notifications')}>
        <FaBell size={24} />
        <p>Notificaciones</p>
      </div>
    </div>
  );
}

export default Toolbar;
